import 'bootstrap/dist/css/bootstrap.min.css';
import { useState } from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";
import {AccessTokenContext} from "./context/LoginContext"
import TrafficChangeChart from './pages/trafficChangeChart';
import PopularDomains from './pages/popularDomains';
import AttackChart from './pages/attackLayer';
import SmartReroute from './pages/SmartReroute';

function App() {
  // store JWT token here, derive username later rather than store it as it's own
  const [accessToken, setAccessToken] = useState("");

  return (
    <AccessTokenContext.Provider value={{accessToken, setAccessToken}}>
    <Router>
      <div>
            <TrafficChangeChart />
            <PopularDomains />
            <AttackChart />
          <Route path='/'>
            <SmartReroute />
          </Route>
      </div>
    </Router>
    </AccessTokenContext.Provider>
  );
}

export default App;
